import { BrowserRouter, Route, Router } from "react-router-dom";
import "./App.scss";
import HomePage from "./homePage/HomePage";
import Login from "./login/Login";

function App() {
  return (
    <BrowserRouter>
      <Route>
        <Route path="/HomePage" Component={HomePage} />
        <Route path="/login" Component={Login} />
      </Route>
    </BrowserRouter>
  );
}

export default App;
